import { Link, Outlet } from 'react-router-dom';
import { classes } from './Navigation.module.css';

const Navigation = () => {
    return(
        <>
        <nav>
            <ul className={classes.navListWrapper}>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/tasks">Tasks</Link>
                </li>
            </ul>
        </nav>
        <Outlet/>
        </>
    );
}  
export default Navigation;
